import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import axios from 'axios';
import './index.css';

// Components
const Navbar = () => (
  <header className="header">
    <div className="logo">AZEXAI</div>
    <nav className="nav">
      <Link to="/">Home</Link>
      <Link to="/dashboard">Dashboard</Link>
      <Link to="/analytics">Analytics</Link>
      <Link to="/about">About</Link>
      <Link className="cta" to="/login">Launch Platform</Link>
    </nav>
  </header>
);

const Footer = () => (
  <footer>
    <div className="footer-main">
      <p><strong>© AzexAI, 2026. All rights reserved.</strong></p>
      <p>Analytical information only. Not an investment recommendation.</p>
    </div>
  </footer>
);

// Pages
const LandingPage = () => {
  const [indices, setIndices] = useState([]);

  useEffect(() => {
    const fetchIndices = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/v1/indices');
        if (response.data.success) {
          setIndices(response.data.data);
        }
      } catch (error) {
        console.error('Error fetching indices:', error);
        // Fallback data
        setIndices([
          { name: 'IIT-S', value: 9.37 },
          { name: 'Zenith', value: 124.50 },
          { name: 'Nexus', value: 89.20 },
          { name: 'Synergy', value: 45.30 },
          { name: 'Genesis', value: 78.90 }
        ]);
      }
    };

    fetchIndices();
    const interval = setInterval(fetchIndices, 30000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="content-wrapper">
      <section className="hero">
        <h1>AzexAI Index Intelligence</h1>
        <p className="hero-subtitle">Analytical index platform for scenario modeling and risk intelligence. Powered by proprietary computational frameworks.</p>
        <div className="tickers">
          {indices.map((index, i) => (
            <div key={i} className="ticker">
              {index.name || index.indexName}
              <span className="ticker-value">
                {typeof index.value === 'number' ? index.value.toFixed(2) : index.value}
              </span>
            </div>
          ))}
        </div>
      </section>

      <section id="products">
        <h2>Products</h2>
        <div className="cards">
          <div className="card">
            <h3>Basic Index</h3>
            <p>Public analytical index access for fundamental market intelligence and risk assessment. Real-time data aggregation and synthesis.</p>
            <Link to="/dashboard">View Indices →</Link>
          </div>
          <div className="card">
            <h3>Index Plus</h3>
            <p>Deep analytics, benchmarking, scenario modeling, and advanced computational intelligence for institutional-grade decision-making.</p>
            <Link to="/register">Get Plus Access →</Link>
          </div>
        </div>
      </section>
    </div>
  );
};

const Dashboard = () => (
  <div className="content-wrapper" style={{ padding: '80px' }}>
    <h1>Dashboard</h1>
    <p>Welcome to the AzexAI Dashboard.</p>
    <div className="card" style={{ marginTop: '20px' }}>
      <h3>Real-time Analytics</h3>
      <p>Live data visualization coming soon...</p>
    </div>
  </div>
);

const Login = () => (
  <div className="content-wrapper" style={{ padding: '80px', display: 'flex', justifyContent: 'center' }}>
    <div className="card" style={{ maxWidth: '400px', width: '100%' }}>
      <h3>Login</h3>
      <input type="email" placeholder="Email" style={{ width: '100%', padding: '10px', marginBottom: '10px', background: '#222', border: '1px solid #333', color: '#fff' }} />
      <input type="password" placeholder="Password" style={{ width: '100%', padding: '10px', marginBottom: '20px', background: '#222', border: '1px solid #333', color: '#fff' }} />
      <button style={{ width: '100%', padding: '12px', background: '#00ff88', border: 'none', borderRadius: '4px', color: '#000', fontWeight: 'bold', cursor: 'pointer' }}>Sign In</button>
    </div>
  </div>
);

function App() {
  return (
    <Router>
      <div className="app">
        <div className="bg-grid"></div>
        <Navbar />
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/login" element={<Login />} />
          <Route path="*" element={<div style={{ padding: '100px', textAlign: 'center' }}>404 - Not Found</div>} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
